import React from "react";
import { AppBar, Toolbar, Typography } from "@mui/material";
import logo from "./logo.png";

function Navbar() {
  return (
    <React.Fragment>
      <AppBar>
        <Toolbar>
          <Typography>
            <img src={logo} alt="Logo" width={75} height={75} />
          </Typography>
        </Toolbar>
      </AppBar>
    </React.Fragment>
  );
}

export default Navbar;
